import React, { Component } from "react";

class Projects extends Component {
  constructor(props) {
    super(props);

    this.education = props.projects;
  }

  render() {
    return (
      <section
        className="resume-section p-3 p-lg-5 d-flex align-items-left"
        id="projects"
      >
        <div className="w-100">
          <h3 className="mb-5 text-md-left">Projects</h3>
          {this.projects.map((data, index) => (
            <div
              key={index}
              className="resume-item d-flex flex-column flex-md-row justify-content-between mb-5 text-md-left"
            >
              <div className="resume-content">
                <h4 className="mb-0">{data.projectname}</h4>
                <div className="subheading mb-3">{data.technologyused}</div>
                <div>{data.link}</div>
              </div>
              <div className="resume-date text-md-right">
                <span className="text-primary">{data.time}</span>
              </div>
            </div>
          ))}
        </div>
      </section>
    );
  }
}

export default Projects;
